(12, 'Teste 1 Pielli ', NULL, NULL, 0, '2023-04-19 09:00:00', 16, 1, 1, 1, NULL, 1, 'Teste para acompanhamento de O.S. que é necessária troca de peças, onde nosso atendente fez contato com o cliente, passou o orçamento e está acompanhando o status de aprovação para encaminhar ao setor de manutenção para a execução. \r\nSugestão: É possível anexar o orçamento ou mesmo acesso ao mesmo para que o atendente possa visualizar o orçamento com facilidade? E após aprovado o orçamento, que ele saia das \"tarefas\" ou que fique com o status de orçamento finalizado.   ', 0, '0000-00-00', 1),
(13, '(Teste) Cliente João entrou em contato pedindo Acompanhamento técnico', NULL, NULL, 0, '2023-05-08 17:10:00', 16, 1, 1, 1, NULL, 1, 'O cliente João entrou em contato com a empresa pedindo um e-mail com valores de um acompanhamento técnico para um serviço de terceiros no elevador. \r\nOBS: O João disse que não é o síndico (31) 9.9955-9955', 0, '0000-00-00', 1);
